INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Adam Sandler', '1966-09-09', 'Brooklyn, New York City, New York, USA', 'nm0001191', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjQyNzM2MjM1Ml5BMl5BanBnXkFtZTcwMDE5NjI3Mg@@._V1_.jpg', 'Adam Richard Sandler was born September 9, 1966 in Brooklyn, New York, to Judith (Levine), a teacher at a nursery school, and Stanley Alan Sandler, an electrical engineer. He is of Russian Jewish descent. At 17, he took his first step towards becoming a stand-up comedian when he spontaneously took the stage at a Boston comedy club.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Kevin James', '1965-04-26', 'Stony Brook, New York, USA', 'nm0416673', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUyMTU1ODU4Ml5BMl5BanBnXkFtZTcwNDQ0NTY5NQ@@._V1_.jpg', 'Kevin James was born Kevin George Knipfing on April 26, 1965, in Mineola, New York, to Janet, an office worker, and Joseph Valentine Knipfing, Jr., an insurance agency owner. He has German ancestry.James attended SUNY Cortland where he played fullback on the football team while majoring in sports management.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Chris Rock', '1965-02-07', 'Andrews, South Carolina, USA', 'nm0001674', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTEyNjM5MjgyNzdeQTJeQWpwZ15BbWU3MDAzMzUyODc@._V1..jpg', 'Christopher Julius Rock was born in Andrews, South Carolina and raised in Bedford-Stuyvesant, Brooklyn, New York. He is the son of Rosalie (Tingman), a teacher and social worker for the mentally handicapped, and Julius Rock, a truck driver and newspaper deliveryman, whose own father was a preacher.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('David Spade', '1964-07-22', 'Birmingham, Michigan, USA', 'nm0005450', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE3OTQxMzc0NV5BMl5BanBnXkFtZTgwNDA0NjA0OTE@._V1_.jpg', 'Comic brat extraordinaire David Spade was born on July 22, 1964, in Birmingham, Michigan, the youngest of three brothers. He is the son of Judith J. (Meek), a writer and editor, and Wayne M. Spade, a sales rep, and is of German, English, Irish, and Scottish descent.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Rob Schneider', '1963-10-31', 'San Francisco, California, USA', 'nm0001705', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg0MDE4MTE0MF5BMl5BanBnXkFtZTcwOTYyOTM3MQ@@._V1_.jpg', 'Robert Michael "Rob" Schneider (born October 31, 1963) is an American actor, comedian, screenwriter, and director. A stand-up comic and veteran of the NBC sketch comedy series "Saturday Night Live", Schneider has gone on to a successful career in feature films, including starring roles in the comedy films "Deuce Bigalow: Male Gigolo", "The Hot Chick", and "Grown Ups".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Salma Hayek', '1966-09-02', 'Coatzacoalcos, Veracruz, Mexico', 'nm0000161', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzkyMTk2NzM2Ml5BMl5BanBnXkFtZTcwNDQ4MjYzMg@@._V1_.jpg', 'One of Hollywood\'s most dazzling leading actresses, Salma Hayek was born on September 2, 1966, in the oil boomtown of Coatzacoalcos, Mexico. Hayek has freely admitted that she and her brother, Sami, were spoiled rotten by her well-to-do businessman father, Sami Hayek Dominguez, and her opera-singing mother, Diana Jim√©nez Medina.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Maria Bello', '1967-04-18', 'Norristown, Pennsylvania, USA', 'nm0004742', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTI3NDE3NTAyOF5BMl5BanBnXkFtZTcwNTg0MDEwMg@@._V1_.jpg', 'Maria Bello was born on 18 April, 1967 in Norristown, Pennsylvania, to Kathy, a nurse and teacher, and Joe Bello, a contractor. She is of Italian and Polish descent. Maria went to Villanova University, majoring in political science. She had every intention of becoming a lawyer, but she took an acting class during her senior year, just for fun.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Maya Rudolph', '1972-07-27', 'Gainesville, Florida, USA', 'nm0748973', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTMzOTQwMzAyOF5BMl5BanBnXkFtZTYwNzA1OTc0._V1_.jpg', 'Maya Rudolph was born in Gainesville, Florida, on July 27th, 1972, to Dick Rudolph, a music producer, and soul singer Minnie Riperton. Her mother was African-American and her father is Ashkenazi Jewish (from a family from Lithuania, Russia, Germany, and Hungary).');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Joyce Van Patten', '1934-03-09', 'New York City, New York, USA', 'nm0887696', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzI1MzMzNDIzNF5BMl5BanBnXkFtZTcwOTkwOTMyNA@@._V1_.jpg', 'Adept at both comedy and drama, veteran actress Joyce Van Patten was born in New York City. Prodded by a typically assertive stage mother, Joyce and her equally famous older brother Dick Van Patten displayed natural talent and did quite well for themselves at an early age.');
