INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Di Quon', 'Unknown', '', 'nm1288309', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNDUwODdhZTItMzNkMC00ZjIyLTkzZDgtN2Y0MDNlZDRhOGExL2ltYWdlXkEyXkFqcGdeQXVyMzUyMDM4MA@@._V1_.jpg', 'Di Quon made her big screen debut as "Lily Kim" in the Columbia Pictures Christmas blockbuster "Maid in Manhattan" starring Jennifer Lopez.Born and raised in Bakersfield, California, Di Quon spent half the year in New York City and during the summer months started modeling.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Steve Buscemi', '1957-12-13', 'Brooklyn, New York City, New York, USA', 'nm0000114', 'https://images-na.ssl-images-amazon.com/images/M/MV5BODc0NTU3NDA4M15BMl5BanBnXkFtZTcwNDkxNzQxNA@@._V1_.jpg', 'Steve Buscemi was born in Brooklyn, New York, to Dorothy (Wilson), a restaurant hostess, and John Buscemi, a sanitation worker. He is of Italian (father) and English, Dutch, and Irish (mother) descent. He became interested in acting during his last year of high school.');
