INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Madison Riley', '1990-03-16', 'Salt Lake City, Utah, USA', 'nm2576486', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjI3MTc5ODA5MV5BMl5BanBnXkFtZTcwMDkyMzY5Nw@@._V1_.jpg', 'Madison Riley is a young, talented American actress. . Madison Riley was born on 16 March 1990 in Salt Lake City, Utah. Born to a motivational speaking father and a stay at home mother. After competing in the Best New Talent competition at the age of 14 in Los Angeles, she decided to leave school early and get started in pursuing her dreams.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jamie Chung', '1983-04-10', 'San Francisco, California, USA', 'nm1512166', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTc5OTQ4MTkzMl5BMl5BanBnXkFtZTgwMzA3NzY0ODE@._V1_.jpg', 'Jamie Chung was born and raised in California, the daughter of Korean parents. She studied Economics at the University of California, Riverside. Chung\'s break came in 2004, when she was working in a sports bar. MTV held auditions for "The Real World" there, she tried out, and was successful, appearing in the San Diego based fourteenth season.');
