INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jake Goldberg', 'Unknown', '', 'nm2326353', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzcyOTQ3MTUwNF5BMl5BanBnXkFtZTcwMjQ2NDQxOA@@._V1_.jpg', 'Jake Goldberg is an American actor best known for his roles in Grown Ups (2010) and Grown Ups 2 (2013). Jake lives in Chappaqua New York with his parents and two sisters. He attends Horace Greeley High School. Jake plays varsity lacrosse and sings in the schools male singing group called Acafellas.');
