INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Nadji Jeter', 'Unknown', 'Atlanta, Georgia, USA', 'nm2684036', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY1MzIxMzI1N15BMl5BanBnXkFtZTgwNTA2OTQwMDE@._V1_.jpg', 'While living in Atlanta, Georgia, Nadji\'s family discovered that he had a gift in dancing, acting, and music. Nadji\'s talents caught the eye of several A-list entertainers, giving him the opportunity to perform for Usher\'s New Look Foundation Gala in New York City in 2005.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('China Anne McClain', '1998-08-25', 'Decatur, Georgia, USA', 'nm1942207', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjI1MDIwODU3MF5BMl5BanBnXkFtZTgwMDY1Njc5NzE@._V1_.jpg', 'China Anne McClain comes from an artistic family. Her father, Michael McClain, is a music producer, vocalist, writer and sound engineer. His first production was on Beyonce\'s younger sister, Solange Knowles (Solo Star CD - track no.16 entitled Sky Away).');
