INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Blake Clark', '1946-02-02', 'Macon, Georgia, USA', 'nm0163703', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjY2NTc4NDcyOF5BMl5BanBnXkFtZTcwMDc2MjcyOA@@._V1_.jpg', 'For the last 20 or so years, Clark has been doing stand-up comedy on the club circuit, on "The Tonight Show", on HBO comedy specials, on "Late Night with David Letterman" and "Late Night with Conan O\'Brien". In addition, he has been in over 50 feature motion pictures and hundreds of episodic TV shows.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Norm MacDonald', '1959-10-17', 'Qu√©bec City, Qu√©bec, Canada', 'nm0005172', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTMyMzg1NDg5OF5BMl5BanBnXkFtZTYwMDAyODU3._V1_.jpg', 'MacDonald was born Norman Gene MacDonald in Qu√©bec City, Qu√©bec on October 17, 1963. He began his career in stand-up comedy. MacDonald\'s first job was writing for "The Dennis Miller Show" and then "Roseanne". While writing for "Roseanne", he was noticed by Lorne Michaels, who liked Norm\'s stand up, and gave him his job on "Saturday Night Live".');
