INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jack Giarraputo', 'Unknown', '', 'nm0316406', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'A prolific producer and 20-year movie industry veteran, Jack Giarraputo has produced movies at Disney, Paramount, Sony, Fox and Warner Brothers that have grossed over $3.5 billion in worldwide box office. Along with partner Adam Sandler, he has built Happy Madison into a consistently successful brand, with an amazing streak of had an amazing streak of 14 different movies that have surpassed the $100 million mark.');
