INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Dartenea Bryant', '0000-09-11', 'Los Angeles, California, USA', 'nm1051000', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNDYzMDcwMDUxMl5BMl5BanBnXkFtZTcwMDUzNDcyMQ@@._V1_.jpg', 'Born to a mother of Spanish descent and an African-American father, Dartenea was born in Los Angeles and raised in the suburban San Gabriel Valley where she grew up riding horses and swimming in the family pool. She began riding motorcycles at the age of 11 and training in martial arts at 12 years old, which earned her black belt in Kung Fu & a class "M" license by the time she graduated from high school.');
