INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jwaundace Candece', '1978-01-13', 'Atlanta, Georgia, USA', 'nm1330195', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk5Mzg1MjA5NV5BMl5BanBnXkFtZTcwNzU1NDg3Nw@@._V1_.jpg', 'Jwaundace Candece moved to Los Angeles in January 2000 from Atlanta to pursue a career in acting. Because of her athletic abilities, she ended up auditioning with thousands of girls for WOW (Women of Wrestling) TV series that aired in 2000. She booked a role as a good guy but refused unless she became a heel (bad guy).');
