INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Mark Fitzgerald', 'Unknown', '', 'nm0280323', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Mark Fitzgerald is by far Boston\'s leading Hollywood film location manager and scout. He knows the ins and outs of every suburb of Boston and is capable of securing locations that no one else can. After spending the last 15 years working on almost every feature film shot in Boston, Mark has created a very full and impressive resume.');
