INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Christopher Willis', 'Unknown', '', 'nm3010524', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Christopher Willis composes the music to Disney\'s "Mickey Mouse", and co-writes the music to the Emmy Award-winning show "Veep". He has also (as an "additional music" composer) contributed to a number of major Hollywood movies, including "The Twilight Saga: Breaking Dawn - Part 2", "X: First Class", "Winnie the Pooh", "Shrek Forever After" and "Bedtime Stories".');
