INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Claire Candela', 'Unknown', '', 'nm3599801', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ3NjY0NTk4N15BMl5BanBnXkFtZTgwMTA2OTU0MTE@._V1_.jpg', 'Claire began acting at age 4, being the youngest of 3 girls she did not want to be left in the dust. Claire has done Film, TV, commercials, and Theatre. She originated the role of "Ivonka" in the multi-award winning musical ONCE. Her latest role was that of "Sarah Summers" in the American Repertory Theatre\'s production on The Heart of Robin Hood.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Patrick Canty', 'Unknown', '', 'nm2773552', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Patrick Canty grew up in Billerica, Massachusetts playing sports throughout his childhood and into high school. His passion for film started at a young age as he would quote movie lines verbatim at his leisure.Attending Salem State College while playing lacrosse and working full time bartending in Boston kept Patrick busy, but did not satisfy his inner goals.');
